import { useState } from 'react';
import NavBar from '../components/NavBar';

export default function ExampleBios() {
  const [tabState, setTabState] = useState(0);

  const example0 = `📍Berlin
Politics on Instagram. Interested in startups. Media studies. 25 years old.
`;

  const example1 = `Munich
Politics on Instagram. Interested in startups. Media studies. 25 years old.
`;

  const example2 = `Frankfurt
Politics on Instagram. Interested in startups. Media studies. 25 years old.
`;

  const renderData = (param) => {
    switch (param) {
      case 0:
        console.log('asd');
        return example0;
      case 1:
        console.log('bb');
        return example1;
      case 2:
        console.log('cc');
        return example2;
      default:
        return example0;
    }
  };

  return (
    <div className="sm:px-6 lg:px-8 max-w-screen-xl mx-auto">
      <div className="flex flex-col justify-between min-h-screen">
        <header className="">
          <NavBar />
        </header>
        <main className="mt-14 flex-1">
          <h1 className="p-2 text-4xl font-semibold text-center text-gray-900">
            Three engaging bios with different styles for your profile
          </h1>
          <div>
            <div>
              <div className="sm:hidden">
                <label htmlFor="tabs" className="sr-only">
                  Select a tab
                </label>
                <select
                  id="tabs"
                  name="tabs"
                  className="focus:ring-indigo-500 focus:border-indigo-500 block w-full border-gray-300 rounded-md"
                >
                  <option>My Account</option>
                  <option>Company</option>
                  <option selected>Team Members</option>
                  <option>Billing</option>
                </select>
              </div>
              <div className="sm:block hidden mt-16 text-center">
                <nav
                  className="flex justify-center space-x-4"
                  aria-label="Tabs"
                >
                  <button
                    type="button"
                    className={`rounded-xl px-3 py-2 text-4xl font-medium text-gray-700 ${
                      tabState === 0 ? 'bg-clubhouse-orange' : 'bg-gray-400'
                    }`}
                    onClick={() => setTabState(0)}
                  >
                    clean / ⚫
                  </button>
                  <button
                    type="button"
                    className={`rounded-xl px-3 py-2 text-4xl font-medium text-gray-700 ${
                      tabState === 1 ? 'bg-clubhouse-orange' : 'bg-gray-400'
                    }`}
                    onClick={() => setTabState(1)}
                  >
                    fresh / 📚
                  </button>
                  <button
                    type="button"
                    className={`rounded-xl px-3 py-2 text-4xl font-medium text-gray-700 ${
                      tabState === 2 ? 'bg-clubhouse-orange' : 'bg-gray-400'
                    }`}
                    onClick={() => setTabState(2)}
                  >
                    creative / 🥳🔝😎
                  </button>
                </nav>
              </div>
            </div>
          </div>
          <div className="flex justify-center mt-8">
            <div>
              <textarea
                data-row-maxlength="27"
                data-limit-row-len="true"
                rows={20}
                readOnly
                className="p-2 text-2xl outline-none"
              >
                {renderData(tabState)}
              </textarea>
            </div>
          </div>
        </main>
        <footer className="h-8 mb-4">
          <div>Built with ❤️ by Jan Ruettinger</div>
        </footer>
      </div>
    </div>
  );
}
